import React, { useState, useEffect } from "react";
import axios from "axios";

const MovieCategories = () => {
  const API_KEY = process.env.REACT_APP_TMDB_API_KEY;

  const [upcoming, setUpcoming] = useState([]);
  const [nowPlaying, setNowPlaying] = useState([]);
  const [popular, setPopular] = useState([]);
  const [topRated, setTopRated] = useState([]);
  
  const [visibleUpcoming, setVisibleUpcoming] = useState(8);
  const [visibleNowPlaying, setVisibleNowPlaying] = useState(8);
  const [visiblePopular, setVisiblePopular] = useState(8);
  const [visibleTopRated, setVisibleTopRated] = useState(8);

  useEffect(() => {
    const fetchMovies = async () => {
      try {
        const upcomingRes = await axios.get(`https://api.themoviedb.org/3/movie/upcoming?api_key=${API_KEY}&language=ja-JP&page=1`);
        const nowPlayingRes = await axios.get(`https://api.themoviedb.org/3/movie/now_playing?api_key=${API_KEY}&language=ja-JP&page=1`);
        const popularRes = await axios.get(`https://api.themoviedb.org/3/movie/popular?api_key=${API_KEY}&language=ja-JP&page=1`);
        const topRatedRes = await axios.get(`https://api.themoviedb.org/3/movie/top_rated?api_key=${API_KEY}&language=ja-JP&page=1`);

        setUpcoming(upcomingRes.data.results);
        setNowPlaying(nowPlayingRes.data.results);
        setPopular(popularRes.data.results);
        setTopRated(topRatedRes.data.results);
      } catch (error) {
        console.error("映画データの取得に失敗しました", error);
      }
    };

    fetchMovies();
  }, []);

  return (
    <div>
      <h2>公開予定の映画</h2>
      <div className="movie-list">
        {upcoming.slice(0, visibleUpcoming).map(movie => (
          <div key={movie.id} className="movie-item">
            <img src={`https://image.tmdb.org/t/p/w500${movie.poster_path}`} alt={movie.title} />
            <h3>{movie.title} ({movie.release_date?.substring(0, 4)})</h3>
          </div>
        ))}
      </div>
      {visibleUpcoming < upcoming.length && (
        <button className="load-more" onClick={() => setVisibleUpcoming(prev => prev + 8)}>もっと見る</button>
      )}

      <h2>上映中の映画</h2>
      <div className="movie-list">
        {nowPlaying.slice(0, visibleNowPlaying).map(movie => (
          <div key={movie.id} className="movie-item">
            <img src={`https://image.tmdb.org/t/p/w500${movie.poster_path}`} alt={movie.title} />
            <h3>{movie.title} ({movie.release_date?.substring(0, 4)})</h3>
          </div>
        ))}
      </div>
      {visibleNowPlaying < nowPlaying.length && (
        <button className="load-more" onClick={() => setVisibleNowPlaying(prev => prev + 8)}>もっと見る</button>
      )}

      <h2>話題の映画</h2>
      <div className="movie-list">
        {popular.slice(0, visiblePopular).map(movie => (
          <div key={movie.id} className="movie-item">
            <img src={`https://image.tmdb.org/t/p/w500${movie.poster_path}`} alt={movie.title} />
            <h3>{movie.title} ({movie.release_date?.substring(0, 4)})</h3>
          </div>
        ))}
      </div>
      {visiblePopular < popular.length && (
        <button className="load-more" onClick={() => setVisiblePopular(prev => prev + 8)}>もっと見る</button>
      )}

      <h2>評価の高い映画</h2>
      <div className="movie-list">
        {topRated.slice(0, visibleTopRated).map(movie => (
          <div key={movie.id} className="movie-item">
            <img src={`https://image.tmdb.org/t/p/w500${movie.poster_path}`} alt={movie.title} />
            <h3>{movie.title} ({movie.release_date?.substring(0, 4)})</h3>
          </div>
        ))}
      </div>
      {visibleTopRated < topRated.length && (
        <button className="load-more" onClick={() => setVisibleTopRated(prev => prev + 8)}>もっと見る</button>
      )}
    </div>
  );
};

export default MovieCategories;
